import React, { useState, useEffect } from 'react';

const Home = () => {
    return (
    <div idx='Title'>Who am I?
      <div idx='Summary'>
        I'm a software engineer with a passion for building impactful, high-quality products, combining a strong academic foundation in software and biomedical engineering with hands-on experience across the stack. 
        I hold a Distinction MSc in Software Engineering and enjoy working on everything from backend services and APIs to intuitive frontend interfaces using frameworks like Flask, .NET, and React. 
        I’m particularly excited by the potential of AI and machine learning to transform how we build and interact with software, and I’ve applied these technologies to create real-time, intelligent tools. 
        Fluent in English and French, I thrive in collaborative, fast-paced environments where I can contribute to innovative, data-driven products.
      </div>
      <img src='Software_img.webp' alt='software engineer'/> 
    </div>
    );
  };

  export default Home;
